script: |
  super -f text -I q3195.spq | sort > q3195.out

inputs:
  - name: q3195.spq
    data: |
      SELECT ( - col1 ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL IN ( col1, - col0 * - 58 - - 19 + col1, - 3 / - col2 + col1 + + ( 29 ) );
  - name: tab0

outputs:
  - name: q3195.out
    data: |
